/*************************|SUBJECT AREAS|**************************/;
CREATE TABLE `subject_areas`(
	`id_subject_area` INTEGER PRIMARY KEY,
    `name_pt` TEXT COLLATE NOCASE,
    `name_en` TEXT COLLATE NOCASE,
    `name_es` TEXT COLLATE NOCASE
);
/****************************|END|*********************************/;

/**************************|JOURNALS|******************************/;
CREATE TABLE `journals`(
    `id_journal` INTEGER PRIMARY KEY,
    `acronym` TEXT,
    `publisher_city` TEXT,
    `publisher_name` TEXT COLLATE NOCASE,
    `publisher_country` TEXT,
    `institutional_url` TEXT,
    `status` TEXT,
    `scielo_url` TEXT,
    `title` TEXT COLLATE NOCASE,
    `title_search` TEXT COLLATE NOCASE
);
/****************************|END|*********************************/;

/********************|SUBJECT AREAS JOURNALS|**********************/;
CREATE TABLE `subject_areas_journals`(
    `id_subject_area` INTEGER,
    `id_journal` INTEGER,
    FOREIGN KEY(id_subject_area) REFERENCES subject_areas(id_subject_area),
    FOREIGN KEY(id_journal) REFERENCES journals(id_journal)
);
/****************************|END|*********************************/;

/***************************|DATASET|*******************************/;

/****************************|END|*********************************/;
